BEGIN TRANSACTION;
CREATE TABLE "users" (
	`id`	string,
	`username`	string NOT NULL,
	`password`	string NOT NULL,
	`createdAt`	DATETIME NOT NULL,
	`updatedAt`	DATETIME NOT NULL,
	`applicationId`	VARCHAR(255),
	PRIMARY KEY(id)
);
CREATE TABLE `applications` (`id` VARCHAR(255) PRIMARY KEY, `secret` VARCHAR(255), `createdAt` DATETIME NOT NULL, `updatedAt` DATETIME NOT NULL);
;
;
COMMIT;
